"""
Purpose:
	Automatically log into HackTheBox and download and start openvpn connection
Requirements:
	Linux
	Python 3
	Selenium (pip3 install selenium)
	HTB email, password and sudo password entered in on lines 26-29 or in command line
Usage: 
	python HackTheBox.py
	or
	python HackTheBox.py <email> <password> <sudopassword>
Notes:
	Change sleep time in seconds on line 83 if your file can not download fast enough
"""

from selenium import webdriver
import time
import sys
import subprocess
from subprocess import Popen, PIPE
import os
from sys import argv

#Hardcoded passwords = bad, fill in with your HTB login and sudo password anyways
email = ""
password = ""
#Sudo password is default kali
sudoPassword = "kali"

#Checks if you entered credentials in command line, if not skips
try:
	script, email, password, sudoPassword = argv
	os.system('clear')
except ValueError:
	pass

#Performs command as sudo
def sudoEx(command):
	p = Popen('sudo -S ' + command, stdin=PIPE, stdout=PIPE, stderr=PIPE, universal_newlines=True, shell=True)
	out, err = p.communicate(sudoPassword + '\n')
	return out

#Performs command as current user
def regEx(command):
	p = Popen(command, stdin=PIPE, stdout=PIPE, stderr=PIPE, universal_newlines=True, shell=True)
	out, err = p.communicate()
	return out

#Removes previous ovpn files in directory
files = os.listdir()
for file in files:
	if "ovpn" in file:
		regEx("rm " + file)

#Gets current directory to save ovpn file to
pwd = regEx('pwd')[:-1]

#Opens up firefox webdriver and sets preferences
fp = webdriver.FirefoxProfile()
fp.set_preference("browser.download.dir", pwd)
fp.set_preference("browser.download.folderList", 2)
fp.set_preference("browser.helperApps.neverAsk.saveToDisk","text/plain")
driver = webdriver.Firefox(fp)

#Removes log file so you dont have to
regEx("rm geckodriver.log")

#Finds and fills in login
driver.get('https://www.hackthebox.eu/home/machines')
emailForm = driver.find_element_by_id("email")
emailForm.send_keys(email)
passwordForm = driver.find_element_by_id("password")
passwordForm.send_keys(password)
#Clicks remember me then clicks login
driver.find_element_by_xpath('/html/body/div[3]/section/div/div/div/form/div[3]/div[1]/div/label/div').click()
driver.find_element_by_xpath('/html/body/div[3]/section/div/div/div/form/div[3]/div[2]/div/button').click()

#Downloads ovpn file and goes back to machines
driver.get('https://www.hackthebox.eu/home/htb/access')
driver.find_element_by_xpath('/html/body/div[2]/section/div[2]/div[3]/div/div/div/div/div[3]/div/div[2]/a').click()
#Time to wait for file download
time.sleep(5)
driver.get('https://www.hackthebox.eu/home/machines')

#Finds ovpn file
files = os.listdir()
for file in files:
	if ".ovpn" in file:
		ovpn = file
		break

#Runs ovpn file silently
os.system('clear')
